script: |
  super -f text -I q10395.spq | sort > q10395.out

inputs:
  - name: q10395.spq
    data: |
      SELECT - col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( col2 * + + 18, + col2 + - - 3, - - CAST ( + + CAST ( NULL AS INTEGER ) AS REAL ), col2 - col1 );
  - name: tab1

outputs:
  - name: q10395.out
    data: |
